INSERT INTO `metabase_table` VALUES
(1,'2023-12-04 10:42:45','2023-12-10 16:39:00','PRODUCTS','Includes a catalog of all the products ever sold by the famed Sample Company.','entity/ProductTable','',1,'Products',NULL,'PUBLIC','Is it? You tell us!','The rating column is an integer from 1-5 where 1 is dreadful and 5 is the best thing ever.','\0','database','complete','\0'),
(2,'2023-12-04 10:42:45','2023-12-10 16:39:00','ORDERS','Confirmed Sample Company orders for a product, from a user.','entity/TransactionTable','',1,'Orders',NULL,'PUBLIC','Is it? You tell us!','You can join this on the Products and Orders table using the ID fields. Discount is left null if not applicable.','\0','database','complete','\0'),
(3,'2023-12-04 10:42:45','2023-12-10 16:39:00','ANALYTIC_EVENTS','Piespace does some anonymous analytics tracking on how users interact with their platform. Theyve only had time to implement a few events, but you know how it is. Pies come first.','entity/EventTable','',1,'Analytic Events',NULL,'PUBLIC','Is it? Well let you be the judge of that.','Piespace has cracked time travel, so keep in mind that some events may have already happened in the future.','\0','database','complete','\0'),
(4,'2023-12-04 10:42:45','2023-12-10 16:39:00','FEEDBACK','With each order of pies sent out, Piespace includes a place for customers to submit feedback and review their order.','entity/GenericTable','',1,'Feedback',NULL,'PUBLIC','Is it? Well let you be the judge of that.','Not every account feels inclined to submit feedback. Thats cool. Theres still quite a few responses here.','\0','database','complete','\0'),
(5,'2023-12-04 10:42:45','2023-12-10 16:39:00','PEOPLE','Information on the user accounts registered with Sample Company.','entity/UserTable','',1,'People',NULL,'PUBLIC','Is it? You tell us!','Note that employees and customer support staff will have accounts.','\0','database','complete','\0'),
(6,'2023-12-04 10:42:45','2023-12-10 16:39:00','INVOICES','Confirmed payments from Piespaces customers. Most accounts pay for their pie subscription on a monthly basis.','entity/GenericTable','',1,'Invoices',NULL,'PUBLIC','Is it? Well let you be the judge of that.','You can group by Account ID to see all the payments from an account and unveil information like total amount paid to date.','\0','database','complete','\0'),
(7,'2023-12-04 10:42:45','2023-12-10 16:39:00','ACCOUNTS','Information on customer accounts registered with Piespace. Each account represents a new organization signing up for on-demand pies.','entity/UserTable','',1,'Accounts',NULL,'PUBLIC','Is it? Well let you be the judge of that.','Piespaces business operates with a two week trial period. If you see that Canceled At is null then that account is still happily paying for their pies.','\0','database','complete','\0'),
